import React from 'react';
import { Link } from 'react-router-dom';
import { Sidebar, SidebarItem } from '@../../../../reactify-ui/build';

const ComponentsList = routes => (
  <Sidebar className="w-100">
    {Object.values(routes).map(route => (
      <SidebarItem className="list-group-item" key={route.name}>
        <Link className="d-block" to={route.path}>
          {route.name}
        </Link>
      </SidebarItem>
    ))}
  </Sidebar>
);

export default ComponentsList;
